:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, John William and BUSBY, Sarah
  06> WILLIAMS, John William m on 03.05.1854 to BUSBY, Sarah
  b 06.04.1827 d 27.04.1904
  b 28.09.1835 d 29.04.1913
  John b, at Paihia and d. at Napier. Sarah, d/o James Busby and Agnes Dow, b. at Waitangi,
  Bay of Islands and d. at Gisborne.
  John was educated at St John's College, Waimate and farmed at Pakaraka. He served on the
  Auckland Provincial Council (1863-65) and represented the Bay of Islands and Maunganui in
  Parliament (1873-79). They moved to Napier late in life and, after John's death, Sarah
  A moved to Gisborne where she lived at Pakaraka in Russell Street until her death.
  01> WILLIAMS, Agnes Lydia m on 02.01.1882 to WILLIAMS, Thomas Sydney
  b 09.07.1855 d 30.12.1940
  b 27.11.1847 d 25.05.1928
  Agnes b. at Pakaraka and d. at Kaharau. Sydney, s/o Edward Marsh Williams and Jane Davis. Agnes and Sydney were
  cousins. Their biographies and descendants are listed under Sydney's entry in this Family Tree.
  02> WILLIAMS, James Alexander
  b 26.07.1857 d 14.05.1864
  James b. and d. (from tetanus) at Pakaraka.
  03> WILLIAMS, Edward Heathcote
  b 23.03.1859 d 28.11.1931
  Heathcote b. at Pakaraka and d. at Paihia. He was educated at Church of England Grammar School and was a lawyer
  and orchardist at Hastings. He was also a cricket enthusiast.
  04> WILLIAMS, George Alexander m on 08.04.1896 to (1)COOPER, Edith Ida
  b 24.11.1861 d 08.11.1938
  b 07.05.1873 d 01.12.1924
  Alexander b. at Pakaraka. He was educated at Church of England Grammar School and was an original partner in
  Abraham and Williams, Palmerston North. He was a romney sheep and cattle breeder and manager of "St Lawrence"
  station at Otane, Hawkes Bay for the Anglican Church. Alex captained a winning Saville Cup Polo Team in the
  early 1890's and was a Hawkes Bay rugby representative. Edith was a brilliant pianist.
  01> WILLIAMS, Richard Dow
  b 30.01.1897 d ** ** ****
  Richard b. at Pahiatua. Richard was a sheepfarmer at "St Lawrence", Otane.
  02> WILLIAMS, Robert Cooper m on 18.04.1928 to CRAMPTON, Nancy
  b 01.05.1901 d 06.02.1968
  b 18.09.1906 d 25.08.1983
  Robert b, at Patangata.
  Robert was a sheepfarmer on "Waikaha" station, Hastings and started, with his son, Nicholas, the Waikaha
  Shorthorn Stud. They imported a number of cattle from Scotland, both male and female, of Calrossie
  bloodlines, and bred many champions at both Royal and provincial A&P shows.
  Robert also had a busy and successful commercial life. He was a director of a number of companies,
  including Richardson and Co, and a farm and forestry company. He was Managing Director, and later
  Chairman, of de Pelichet McLeod & Co Ltd. He also served a term as President of the Hastings Chamber of
  Commerce, President of the Shorthorn Cattle Society, and President of the Hastings Club. He was also, at
  one time or another, Chairman of Trustees of the Royston Private Hospital and of the Hereworth Preparatory
  School. For many years he was a member of the General Committee of the Hawkes Bay A&P Society, and was
  Chairman of the Cattle Committee.
  Nancy was on the Board of Trustees of Woodford House.
  01> WILLIAMS, Gerard Robin m on 23.03.1954 to (1)LOWRY, Elizabeth Helen
  b 19.09.1929
  b 18.02.1932
  Robin b. at Hastings and m. at Wellington. Helen, d/o Ralph Lowry and Betty Johnston, b. at Hastings.
